import { createMuiTheme} from '@mui/material';


const lightTheme = createMuiTheme({
  palette: {
    primary: {
      main: '#388e3c',
      light: '#66bb6a',
      dark: '#2e7d32',
    },
    secondary: {
        main: '#558b2f',
        light: '#ffee58',
        dark: '#f9a825',
    }
  }
})


const darkTheme = createMuiTheme({
  palette: {
    mode: 'dark',
  }
})

export default lightTheme;
